-- Create table 系统所有服务对应菜单表
create table service_vs_menu
(
   service_id           varchar(64) not null comment '服务ID',
   menu_id              varchar(64) not null comment '菜单Id'
);

alter table service_vs_menu comment '系统所有服务对应菜单表--SERVICE_VS_MENU';

alter table service_vs_menu add constraint FK_Reference_3 foreign key (service_id)
      references SYS_SERVICE (id) on delete restrict on update restrict;

alter table service_vs_menu add constraint FK_Reference_4 foreign key (menu_id)
      references sys_menu_dict (id) on delete restrict on update restrict;
